import OPGGButton from '../widgets/OPGGButton/OPGGButton';

export default {
    title: 'widgets/OPGGButton',
    component: OPGGButton,
  };

const Template = (args) => <OPGGButton {...args} />;

export const Primary = Template.bind({});
